// External API containing mock data for various endpoints
const { numOfFakeUsers, accountUserTypes } = require('../../config/globals.js');
const faker = require('faker');

// For loop to generate numOfFakeUsers
const generateSeeds = () => {
  let arr = [];
  for (let i = 1; i <= numOfFakeUsers; i++) {
    arr.push({
      user_id: i,
      subscribed_at: Date.parse(
        faker.date.between(
          new Date(Date.now() - (1000 * 60 * 60 * 24 * 7)),
          new Date(Date.now() - (1000 * 60 * 60 * 24 * 5))
        )
      )
    });
  }

  // our test accounts (owners) for authentication/authorization
  const admin = accountUserTypes[accountUserTypes.length - 1];
  arr.push({
    user_id: 501,
    avatar:
      'data:image/jpeg;base64,',
    user_type: admin,
    subscribed_at: Date.parse(
      faker.date.between(
        new Date(Date.now() - (1000 * 60 * 60 * 24 * 7)),
        new Date(Date.now() - (1000 * 60 * 60 * 24 * 5))
      )
    ),
    signature: 'Symposium Developer\n\n-James Page'
  });
  arr.push({
    user_id: 502,
    user_type: admin,
    subscribed_at: Date.parse(
      faker.date.between(
        new Date(Date.now() - (1000 * 60 * 60 * 24 * 7)),
        new Date(Date.now() - (1000 * 60 * 60 * 24 * 5))
      )
    )
  });
  arr.push({
    user_id: 503,
    user_type: admin,
    subscribed_at: Date.parse(
      faker.date.between(
        new Date(Date.now() - (1000 * 60 * 60 * 24 * 7)),
        new Date(Date.now() - (1000 * 60 * 60 * 24 * 5))
      )
    )
  });
  arr.push({
    user_id: 504,
    user_type: admin,
    subscribed_at: Date.parse(
      faker.date.between(
        new Date(Date.now() - (1000 * 60 * 60 * 24 * 7)),
        new Date(Date.now() - (1000 * 60 * 60 * 24 * 5))
      )
    )
  });
  arr.push({
    user_id: 505,
    user_type: admin,
    subscribed_at: Date.parse(
      faker.date.between(
        new Date(Date.now() - (1000 * 60 * 60 * 24 * 7)),
        new Date(Date.now() - (1000 * 60 * 60 * 24 * 5))
      )
    )
  });
  return arr;
};

exports.seed = function (knex, Promise) {
  // Deletes ALL existing entries
  return knex('user_settings')
    .del()
    .then(function () {
      // Inserts seed entries
      return knex('user_settings').insert(generateSeeds());
    });
};
